import React, { useState } from "react";
import { AiFillCaretLeft, AiFillCaretRight } from "react-icons/ai";

const Projects = () => {
  let [projects, setProjects] = useState([
    {
      ID: 1,
      Project_Name: "COVID19-TRACKER",
      Stacks: "HTML, CSS, JAVASCRIPT, REACT, CHARTJS",
      URL: "http://covid_19_tracker.surge.sh/",
    },
    {
      ID: 2,
      Project_Name: "QUIZ-APP",
      Stacks: "HTML, CSS, JAVASCRIPT, REACT, TYPESCRIPT, PWA",
      URL: "http://quiz-app-project.surge.sh/",
    },
  ]);
  return (
    <div className="projects">
      <h1>Projects</h1>
      <div>
        <button>
          <AiFillCaretLeft />
        </button>
        {projects.map((project, index) => (
          <div key={index}>
            <p>{project.ID}</p>
            <p>{project.Project_Name}</p>
            <p>{project.Stacks}</p>
            <p>{project.URL}</p>
          </div>
        ))}
        <button>
          <AiFillCaretRight />
        </button>
      </div>
    </div>
  );
};

export default Projects;
